import thumbnail from "../images/image-product-1-thumbnail.jpg"

const Cart = () => {
  return (
    <div className="bg-white rounded-2xl shadow-2xl p-8">
      <h1 className="border-b border-slate-400">Cart</h1>
      <button className="flex items-center justify-center  space-x-4 bg-Orange  py-2 px-4 w-full text-center font-bold text-White rounded-lg shadow mt-5 hover:bg-orange-600 transition-all duration-200 ">Checkout</button>
    </div>
    
    
  );
};

export default Cart;
